Work Mode:
Responsibilities:
Responsible for collecting and analyzing data, developing the data tag system and its association with blockchain data automatically;
Responsible for data analysis and presenting results according to the team's requirements;
Responsible for the development of community automation robot, automated data processing and distribution platform.
Requirements:
Have experience in data analysis or relevant areas, capable of acquiring, analysing data and outputting insights promptly;
Knowledge of Web3 products, especially data-driven products;
Experience with at least one of the following skills: ETL/Distributed crawler system and background interface development/SQL&Tableau.Show more Report

You will work with colleagues from different countries, and learn from top talents and experts in the game industry.
 You will also have the opportunity to experience the entire process of developing games from creative thoughts to launch.
 By leveraging our data system, you can feel how it improves the game products. You will have the opportunity to discuss with teams in the fields: data mining, algorithms, AI etc., brainstorming together, and making ideas come true;
 You will work with a large amount of data to design the game's data analysis plan, discover business problems based on data metrics, step by step, and gradually approach the "truth";
 You can make an impact on different aspects of data analysis, mining, and data products, by summarising the complicated in-game behaviours and data of the players into concise conclusions, which will directly contribute to the growth and optimisation of the game.
 Bachelor degree or above with majors in statistics, mathematics, economics, informatics are preferred.
